import React from 'react';
import TodoItem from './TodoItem';

import {
    Card,
    Checkbox,
    IconButton,
    List,
    ListItem,
    ListItemIcon,
    ListItemText,
} from "@material-ui/core";
import { Clear, Create } from "@material-ui/icons";

function Todo({ todos }) {
    return (
        <Card>
            <List
                sx={{
                    width: 200,
                    height: 230,
                    bgcolor: "background.paper",
                    overflow: "auto",
                }}
                dense
                component="div"
                role="list"
            >
                {todos.map((todo) => (
                            <TodoItem
                                todo={todo}
                                key={todo.id}
                            />
                        ))}
            </List>
        </Card>
    );
}

export default Todo;
